import React from "react";

const Gallery = () => {

	const imglinks = ["../assets/images/gallery1.jpeg", "../assets/images/gallery2.jpeg", "../assets/images/gallery3.jpeg", "../assets/images/gallery4.jpeg", "../assets/images/gallery5.jpeg", "../assets/images/gallery6.jpeg"]

  return (

  	<div>
  	<div class="gallery">
	  <img src={require("../assets/images/gallery1.jpeg")} />
	  <img src={require("../assets/images/gallery2.jpeg")} />
	  <img src={require("../assets/images/gallery3.jpeg")} />
	  <img src={require("../assets/images/gallery3.jpeg")} />
	</div>
	<br/>
	</div>
  )
};

export default Gallery;
